    let [data, setData] = useState<[]>([])
    useEffect(()=>{
    async function getData (){
      let tempData:[] = await GetData()
      setData(tempData)
      console.log(data)
    }
    getData()
    },[])
    return (
    <Container>
    {data.map(x => <Content x={x}></Content>)}
    </Container>
    )

}
export default ContentBorad

const Container =styled.div`
width: 80%;
